import { InputDetailsPage } from './containers/InputDetailsPage';
import OverViewPage from './containers/OverViewPage';

class Main extends Component {
    render() {
      return (
        <Router>
          <div>
            <h1>Over View Application</h1>
            <ul className="header">
            </ul>
            <Card raised>
              <div className="content">

              </div>
            </Card>
          </div>
        </Router>
      );
    }
  }

export default Main;
